import { Cell } from "./DayStyle"
import { Row } from "./DayStyle"
import { Day } from "./DayStyle"
import { CurrentDay } from "./DayStyle"

function getDay(day) {
    return day.format('D');
}

function isCurrentDay(day, currentDay) {
    if(getDay(day) === 1) {
        console.log(day);
        console.log(currentDay);
        console.log(day === currentDay);
    }
    
    if(day === currentDay) {
        console.log(currentDay);
        return (
            <CurrentDay>{getDay(day)}</CurrentDay>
        );
    } else {
        return getDay(day);
    }
}


export function DaySell({day, currentDay}) {
    return (
        <Cell
            weekend={day.day() === 6 || day.day() === 0}
        >
            <Row
                justify={'flex-end'}
            >
                <Day>
                    {isCurrentDay(day, currentDay)}
                </Day>
            </Row>
        </Cell>
    )
}
